import React from 'react';

export function SelectedMember(props){
    const {pickedName} = props
    return (
        <div className="app_randomgroup_result">
            <p className="app_randomgroup_result--name">{pickedName}</p>
            <p>Will be making the coffee</p>
        </div>
    )
}
